class Solution:
    def canConvertStringo(self, s: str, t: str, k: int) -> bool:
        '''
        超时
        '''
        l1, l2 = len(s), len(t)
        if l1 != l2:
            return False
        vis = set()
        for i in range(l1):
            val = ord(t[i]) - ord(s[i])
            if val == 0:
                continue
            if val < 0:
                val += 26
            while val <= k:
                if val not in vis:
                    vis.add(val)
                    break
                val += 26
            if val > k:
                return False
        return True

    def canConvertString(self, s: str, t: str, k: int) -> bool:
        if len(s) != len(t):
            return False
        
        counts = [0] * 26
        for si, ti in zip(s, t):
            difference = ord(ti) - ord(si)
            if difference < 0:
                difference += 26
            counts[difference] += 1
        
        for i, count in enumerate(counts[1:], 1):
            maxConvert = i + 26 * (counts[i] - 1)
            if maxConvert > k:
                return False
        
        return True

s = Solution()

print(s.canConvertString('input', 'ouput', 9))
print(s.canConvertString('aab', 'bbb', 27))
print(s.canConvertString('atmtxzjkz', 'tvbtjhvjd', 27))

ss = ""
tt = ""
k = 615804

print(s.canConvertString(ss, tt, k))
